%% H_eom.m
%
% Description:
%   Wrapper function for autogen_H.m
%   Computes H(q,q_dot) for the jumping robot.
%
% Inputs:
%   x: the state vector, x = [q; q_dot];
%   params: a struct with many elements, generated by calling init_params.m
%
% Outputs:
%   H: a 5x1 set of terms.

function H = H_eom(x,params)


% autogen inputs;
% boardMass,boardTheta,boardDTheta,boardHeight,bottomLinkRCoM,bottomLinkMass,
% bottomLinkTheta,bottomLinkDTheta,
% bottomLinkHeight,g,topLinkRCoM,topLinkMass,topLinkTheta,topLinkDTheta

H = autogen_H_eom(params.boardMass,...
                  x(3),...
                  x(8),...
                  params.boardHeight,...
                  params.bottomLinkYCoM,...
                  params.bottomLinkMass,...
                  x(4),...
                  x(9),...
                  params.bottomLinkHeight,...
                  params.g,...
                  params.topLinkYCoM,...
                  params.topLinkMass,...
                  x(5),...
                  x(10));
                  

end

